import React from "react";

const SlotM = () => {
  let x = "@";
  let y = "@";
  let z = "@";

  if (x === y && x === z) {
    return (
      <>
        <h1>
          {x} {y} {z}
        </h1>
        <h1> This is Matching :) </h1>
       
      </>
    );
  } else {
    return (
        <>
          <h1>
            {x} {y} {z}
          </h1>
          <h1> This is not Matching :) </h1>
         
        </>
      );
  }
};

const App = () => {
  return (
    <>
      <h1 className="heading_style">
        Welcome to{" "}
        <span style={{ fontWeight: "bold" }}> Slot machine game</span>{" "}
      </h1>

      <SlotM />
    </>
  );
};

export default App;
